import React from "react";
import Login from "../users/Login";

import 
{ BrowserRouter as Router, Routes, Route} 
    from "react-router-dom";

function Header() {
return (
    <header>
        <h1>Keeper</h1>

        <a href=
            {<Router>
                <Routes>
                    {Login}<Route path='/Login' element={<Login/>} />
                </Routes>
            </Router>}>
                Log In
        </a>


    </header>

)};



export default Header;
